import { Link } from "react-router-dom";

export const ItemList = ({ items }) => {
  if (!items) {
    return <p>Loading items...</p>;
  }

  if (items.err) {
    return <p>{items.err}</p>;
  }

  if (items.lenght === 0) {
    return <p>No items to display</p>;
  }

  return (
    <div>
      <h2>Items</h2>
      {items.map((i) => {
        return (
          <li key={i}>
            <Link to={`/items/${i}`}>{i}</Link>
          </li>
        );
      })}
    </div>
  );
};
